#
# TABLE STRUCTURE FOR: aduan
#

DROP TABLE IF EXISTS `aduan`;

CREATE TABLE `aduan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_user` int(11) NOT NULL,
  `id_kategori` int(11) NOT NULL,
  `source` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `judul` varchar(255) NOT NULL,
  `aduan` longtext NOT NULL,
  `lampiran` text NOT NULL,
  `tags` varchar(255) NOT NULL,
  `anonim` int(11) NOT NULL,
  `rahasia` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `view` int(11) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1554357629 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` int(11) NOT NULL,
  `title` int(11) NOT NULL,
  `description` int(11) NOT NULL,
  `media` int(11) NOT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: media__galeri
#

DROP TABLE IF EXISTS `media__galeri`;

CREATE TABLE `media__galeri` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `judul` varchar(255) NOT NULL,
  `deskripsi` longtext NOT NULL,
  `url` varchar(255) NOT NULL,
  `status` int(1) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: media__kamera
#

DROP TABLE IF EXISTS `media__kamera`;

CREATE TABLE `media__kamera` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `judul` varchar(255) NOT NULL,
  `deskripsi` longtext NOT NULL,
  `kamera` longtext NOT NULL,
  `status` int(1) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_grup` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `telepon` varchar(25) NOT NULL,
  `password` varchar(255) NOT NULL,
  `token` varchar(255) NOT NULL,
  `aktif` int(11) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1554357557 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: users__groups
#

DROP TABLE IF EXISTS `users__groups`;

CREATE TABLE `users__groups` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nama_grup` varchar(255) NOT NULL,
  `modul_read` varchar(255) NOT NULL,
  `modul_write` varchar(255) NOT NULL,
  `modul_delete` varchar(255) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: users__groups_modules
#

DROP TABLE IF EXISTS `users__groups_modules`;

CREATE TABLE `users__groups_modules` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nama_grup` varchar(255) NOT NULL,
  `modul_read` varchar(255) NOT NULL,
  `modul_write` varchar(255) NOT NULL,
  `modul_delete` varchar(255) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: users__modules
#

DROP TABLE IF EXISTS `users__modules`;

CREATE TABLE `users__modules` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nama_modul` varchar(255) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;



